class CountIslands {
	 char[][] input;
	 boolean[][] visited;
	 //	Number of islands initialized to 0 for every test case;
	 int count = 0;
	 boolean allHashes =  true;
	 //There is only one output for all test cases, so make it static
	 static int[] output ;

	/*
	 * Given a 2-d matrix that represents water (.) or land (#), determine the
	 * number of islands. Island is a contigous set of connected lands.
	 * Contigous is defined as modular difference of 1 in x or y or both x and y
	 * coordinates. So, an element can have atmost 8 neighbours.
	 */
	public static void main(String[] args) {
		try {
			BufferedReader in = new BufferedReader(new InputStreamReader(
					System.in));
			int t = Integer.parseInt(in.readLine());
			if (t > 20 || t < 1)
				return;
			output = new int[t];
			// for every test case
			for (int i = 0; i < t; i++) {
				
				CountIslands cis = new CountIslands();
				//number of rows and cols
				String[] s = in.readLine().split(" ");
				int n = Integer.parseInt(s[0]);
				int m = Integer.parseInt(s[1]);
				if (n < 1 || n > 201 || m < 1 || m > 201)
					return;
				
				cis.make(n,m,in);
				output[i] = cis.process(n,m);
			}
			BufferedWriter out = new BufferedWriter(new OutputStreamWriter(
					System.out));
			for (int i = 0; i < output.length; i++) {
				int result = output[i];
				out.write(Integer.toString(result));
				out.write("\n");
			}
			out.flush();
			out.close();
		} catch (Exception e) {
			System.exit(0);
		}
	}
	
	void make(int n, int m, BufferedReader in){
		this.input = new char[n][m];
		this.visited = new boolean[n][m];
		//this.allHashes = true;
		//Initialize the count of islands for every test case
		count = 0;
		//Read the next n lines as n rows
		for (int j = 0; j < n; j++) {
			try{
				input[j] = in.readLine().trim().toCharArray();
			//char[] chars = in.readLine().toCharArray();
			// Read all the chars in a line as cols
			/*for (int k = 0; k < m; k++) {
				if (chars[k] != '#' && allHashes) {
					allHashes = false;
				}
				this.input[j][k] = chars[k];
				this.visited[j][k] = false;
			}*/
			}
			catch(Exception e){
				e.printStackTrace();
			}
		}
	}
	
	int process(int n, int m){
		//if (this.allHashes) {
		//count = 1;
	    //} else {
		//For every unvisited element in matrix, look for lands
		for (int j = 0; j < n; j++) {
			for (int k = 0; k < m; k++) {
				if (this.input == null) {
					count = 0;
					break;
				}
				// Process only valid indices and non-border indices
				if (isValid(j, k, n, m)) {
					// If a land is encountered, search for all
					// connected
					// lands
					if (this.input[j][k] == '#' && !(this.visited[j][k])) {
						search(j, k, n, m);
						count++;

					}
					// If water, mark visited
					else {
						this.visited[j][k] = true;
					}
				}
			}
		}
		
	//}
		return count;
	}

	 void search(int row, int col, int n, int m) {
		this.visited[row][col] = true;
		// Search in all 8 possible directions
		if (isValid(row - 1, col, n, m)) {
			if (this.input[row - 1][col] == '#' && !(this.visited[row - 1][col])) {
				this.visited[row-1][col] = true;
				search(row - 1, col, n, m);
			}
			
		}
		if (isValid(row, col - 1, n, m)) {
			if (this.input[row][col - 1] == '#' && !(this.visited[row][col - 1])) {
				this.visited[row][col-1] = true;
				search(row, col - 1, n, m);
			}
		
		}
		if (isValid(row - 1, col - 1, n, m)) {
			if (this.input[row - 1][col - 1] == '#' && !(this.visited[row - 1][col - 1])) {
				this.visited[row-1][col-1] = true;
				search(row - 1, col - 1, n, m);
			}
			
		}
		if (isValid(row + 1, col, n, m)) {
			if (this.input[row + 1][col] == '#' && !(this.visited[row + 1][col])) {
				this.visited[row + 1][col] = true;
				search(row + 1, col, n, m);
			}
			
		}
		if (isValid(row, col + 1, n, m)) {
			if (this.input[row][col + 1] == '#' && !(this.visited[row][col + 1])) {
				this.visited[row][col+1] = true;
				search(row, col + 1, n, m);
			}
			
		}
		if (isValid(row + 1, col + 1, n, m)) {
			if (this.input[row + 1][col + 1] == '#' && !(this.visited[row + 1][col + 1])) {
				this.visited[row+1][col+1] = true;
				search(row + 1, col + 1, n, m);
			}
			
		}
		
		if (isValid(row - 1, col + 1, n, m)) {
			if (this.input[row - 1][col + 1] == '#' && !(this.visited[row - 1][col + 1])) {
				this.visited[row-1][col+1] = true;
				search(row - 1, col + 1, n, m);
			}
			
		}
		if (isValid(row + 1, col - 1, n, m)) {
			if (this.input[row + 1][col - 1] == '#' && !(this.visited[row + 1][col - 1])) {
				this.visited[row+1][col-1] = true;
				search(row + 1, col - 1, n, m);
			}
		
		}
	}

	 boolean isValid(int row, int col, int n, int m) {
		// Invalid index or Border index, dont process it, its always water
		if (row <= 0 || col <= 0 || row >= (n - 1)|| col >= (m - 1)) {
			return false;
		}
		return true;
	}

}

